CREATE SCHEMA customerloyalty;

CREATE SEQUENCE hibernate_sequence start 1 increment 1;
CREATE TABLE customerloyalty.Adjective (
       id int8 not null,
        startsWith char(1) not null,
        text varchar(255),
        primary key (id)
    );
CREATE TABLE customerloyalty.Animal (
       id int8 not null,
        startsWith char(1) not null,
        text varchar(255),
        primary key (id)
    );
CREATE TABLE customerloyalty.LoyaltyMember (
       id int8 not null,
        codeName varchar(255),
        primary key (id)
    );


